/*Table structure for table `gov_item_sort` */

DROP TABLE IF EXISTS `gov_item_sort`;

CREATE TABLE `gov_item_sort` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `item_name` varchar(255) DEFAULT NULL COMMENT '事项名称',
  `ser_obj_sort` int(11) DEFAULT NULL COMMENT '服务对象分类（公民、法人）',
  `ser_content` int(11) DEFAULT NULL COMMENT '服务内容（便民服务、行政审批、内部审批（非行政审批））',
  `pre_approval_matter` int(11) DEFAULT NULL COMMENT '前置审批事项（外键）',
  `deadline` int(11) DEFAULT NULL COMMENT '时限',
  `application_material` varchar(255) DEFAULT NULL COMMENT '申请材料（多行）',
  `certificate_name` varchar(255) DEFAULT NULL COMMENT '所需证件名称',
  `file_type` int(11) DEFAULT NULL COMMENT '办件结果文件类型（证照、批文、证明、其他）',
  `file_name` varchar(255) DEFAULT NULL COMMENT '办件结果文件名称',
  `yesorno` int(2) DEFAULT NULL,
  `bus_system` int(11) DEFAULT NULL COMMENT '业务应用系统名称（默认值为无，外键）',
  `time_create` datetime DEFAULT NULL,
  `time_modified` datetime DEFAULT NULL,
  `isDeleted` int(11) DEFAULT '0',
  `company_id` int(11) DEFAULT NULL COMMENT '单位名称',
  `group_id` int(11) DEFAULT NULL,
  `item_sort_id` int(11) DEFAULT NULL,
  `application_material_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

